import './menu.css'

import { BsYoutube, BsInstagram, BsFacebook} from 'react-icons/bs'

export default function Menu() {
    return (
        <div>
            <a className='social' href='https://youtube.com'>
                <BsYoutube size={24} color='#fff' />
            </a>
        </div>
    )
}
